  "title": {
    "nb": "Offentlig støtte"
  },
  "description": {
    "nb": "Norge har gjennom EØS-avtalen forpliktet seg til å opprette et nasjonalt register for offentlig støtte for tildelinger over 500 000 euro. Skatte og avgiftslettelser er å anse som offentlig støtte og Skatteetaten oppfattes som støttegiver for disse skatte- og avgiftslettelser. \n\nForetak som mottar støtte i form av skatte og/eller avgiftsreduksjon må rapportere dette til Skatteetaten. "
  },
  "descriptionFormatted": {
    "nb": "Norge har gjennom EØS-avtalen forpliktet seg til å opprette et nasjonalt register for offentlig støtte for tildelinger over 500 000 euro. Skatte og avgiftslettelser er å anse som offentlig støtte og Skatteetaten oppfattes som støttegiver for disse skatte- og avgiftslettelser. \n\nForetak som mottar støtte i form av skatte og/eller avgiftsreduksjon må rapportere dette til Skatteetaten. "
  },
  "objective": {
    "nb": "Registeret skal bidra til at opplysningene om offentlig støtte er offentlig tilgjengelig, og slik sikre et konkurransedyktig indre marked."
  },
