  "title": {
    "nb": "Merverdiavgift for primærnæring"
  },
  "description": {
    "nb": "Opplysninger til avgiftsmyndighetene over samlet omsetning, uttak og innførsel, beregnet utgående avgift, fradragsberettiget inngående avgift og avregning mellom utgående avgift og inngående avgift.\n\nMva-meldingen for primærnæring skal en gang pr år leveres av næringsdrivende innen jordbruk, skogbruk og fiske som har omsetning over en viss størrelse av avgiftspliktige varer og tjenester."
  },
